class Solution:
    def minKBitFlips(self, A: 'List[int]', K: 'int') -> 'int':
        numops = 0
        astr = ''.join(map(str, A))
        aint = int(astr, 2)
        # opstr = ['0' for _ in range(len(A))]
        # for i in range(K):
        #     opstr[i] = '1'
        opint = int('1'*K, 2)
        for i in range(len(A)-K+1):
            if astr[i] == '0':
                numops += 1
                # bitnum = int(''.join(opstr),2)
                astr = bin(aint ^ opint<<(len(A)-i-K))[2:]
                aint = int(astr, 2)
            # # opstr[i] = '0'
            # if i + K < len(A):
            #     opstr[i+K] = '1'
        # print(astr)
        return numops if all(map(int, astr)) else -1

